import styled from "styled-components";
import NavBar from "../Components/NavBar";

const Home = () => {
  return (
    <div>
      <h1>안녕하세요</h1>
      <NavBar />
    </div>
  );
};

export default Home;

export const background = styled.div`
  background: #fffcf4;
`;
